const Pro = () => {
  const [posts, setPosts] = useState([]);
  fetch('http://localhost:3000/image/')
  .then(response => response.json())
  .then(data => console.log(data));


  return (
   <div className="posts-container">
      {posts.map((post) => {
         return (
            <div className="post-card" key={post.id}>
             <h1>sdhfsd</h1>
            </div>
         );
      })}
   </div>
   );
};

export default Pro;
